INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 0.0, 4, 4, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 10021, 1, 24015, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 4.0, 4, 1, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 10021, 2, 24016, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 0.0, 4, 4, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 10021, 3, 24017, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 5.2, 1, 2, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 10021, 4, 24018, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 4.2, 5, 6, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 10021, 5, 24019, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 0.0, 2, 2, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 10021, 6, 24020, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 6.4, 1, 6, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 10021, 7, 24021, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 0.0, 2, 2, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 10021, 8, 24022, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 10.08, 6, 3, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 10021, 9, 24023, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 5.0, 1, 2, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10021, 10, 24024, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, 0.0, 2, 2, "2030/12/17 14:59:59", 110501, 24, "カオリ（サマー）", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 10021, 11, 24025, 0.0, "2019/07/31 12:00:00");
